    false,nt"url": null,nt"notes": "This annual narrative report for Waubay
    WMD outlines Refuge accomplishments during the 1990 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    public participation, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, manpower programs, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    croplands, grasslands, grazing, haying, fire management, pest control, water rights,
    and WPA easements. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, animal control, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, and law enforcement. The equipment and facilities section of the
    report provides information about new construction, rehabilitation, equipment replacement,
    and communication systems. Cooperative programs, economic uses of the Refuge, and
    items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
